import Nav from "./navbar";
import Sidebar from "./sidebar";
import ImgSlider from "./slider";
import Card from "./card";

export default function App() {
  return (
    <>
      <Nav></Nav>
      <div className="container">
        <div className="row">
          <div className="col-lg-3">
            <Sidebar></Sidebar>
          </div>
          <div className="col-lg-9">
            <ImgSlider></ImgSlider>
          </div>
        </div>
      </div>
    </>
  );
}
